  summary: "\nValues used in <xref href=\"MathSharp.Vector.Shuffle(System.Runtime.Intrinsics.Vector128%7bSystem.Single%7d%2cSystem.Runtime.Intrinsics.Vector128%7bSystem.Single%7d%2cSystem.Byte)\" data-throw-if-not-resolved=\"false\"></xref>,\n<xref href=\"MathSharp.Vector.Shuffle(System.Runtime.Intrinsics.Vector256%7bSystem.Double%7d%2cSystem.Runtime.Intrinsics.Vector256%7bSystem.Double%7d%2cSystem.Byte)\" data-throw-if-not-resolved=\"false\"></xref>,\n<xref href=\"MathSharp.Vector.Permute(System.Runtime.Intrinsics.Vector128%7bSystem.Single%7d%2cSystem.Byte)\" data-throw-if-not-resolved=\"false\"></xref>,\n<xref href=\"MathSharp.Vector.Permute(System.Runtime.Intrinsics.Vector256%7bSystem.Double%7d%2cSystem.Byte)\" data-throw-if-not-resolved=\"false\"></xref>,\nmethods to dictate the ordering of the resultant vectors\n"
  example:
